PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
DROP TABLE IF EXISTS "companies";
CREATE TABLE companies(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    name TEXT NOT NULL,
    fiscal_address TEXT,
    tax_id TEXT,
    phone TEXT,
    lat REAL DEFAULT 40.4168,
    lng REAL DEFAULT -3.7038
  );
DROP TABLE IF EXISTS "countries";
CREATE TABLE countries(
    code TEXT PRIMARY KEY,
    name TEXT NOT NULL,
    corporate_tax REAL NOT NULL,
    social_rate REAL NOT NULL
  );
DROP TABLE IF EXISTS "employees";
CREATE TABLE employees(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER UNIQUE REFERENCES users(id) ON DELETE CASCADE,
    overtime_rate REAL DEFAULT 15,
    allow_diets INTEGER DEFAULT 1,
    allow_transport INTEGER DEFAULT 1,
    allow_lodging INTEGER DEFAULT 1,
    salary REAL DEFAULT 0,
    daily_hours REAL DEFAULT 8,
    weekly_hours REAL DEFAULT 40,
    vacation_days INTEGER DEFAULT 22,
    dni TEXT,
    birthdate TEXT,
    phone TEXT,
    contact_email TEXT,
    position TEXT,
    contract_type TEXT,
    pay_installments INTEGER DEFAULT 12,
    vacation_days_used INTEGER DEFAULT 0,
    vacation_year INTEGER DEFAULT 2026,
    hire_date TEXT,
    termination_date TEXT
  );
DROP TABLE IF EXISTS "finance_entries";
CREATE TABLE finance_entries(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    month TEXT NOT NULL,
    country_code TEXT NOT NULL,
    incomes REAL NOT NULL,
    expenses REAL NOT NULL,
    salaries REAL NOT NULL
  );
DROP TABLE IF EXISTS "invoices";
CREATE TABLE invoices(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    client_name TEXT NOT NULL,
    amount REAL NOT NULL,
    month TEXT NOT NULL,
    file_path TEXT NOT NULL,
    file_mime TEXT NOT NULL,
    created_at TEXT NOT NULL
  );
DROP TABLE IF EXISTS "password_resets";
CREATE TABLE password_resets(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER REFERENCES users(id) ON DELETE CASCADE,
    token TEXT UNIQUE NOT NULL,
    expires_at TEXT NOT NULL,
    used INTEGER DEFAULT 0
  );
DROP TABLE IF EXISTS "tickets";
CREATE TABLE tickets(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER REFERENCES users(id) ON DELETE CASCADE,
    created_at TEXT NOT NULL,
    category TEXT,
    amount REAL,
    status TEXT DEFAULT 'PENDIENTE',
    reason TEXT,
    file_path TEXT NOT NULL,
    file_mime TEXT NOT NULL
  );
DROP TABLE IF EXISTS "timesheet_requests";
CREATE TABLE timesheet_requests(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER REFERENCES users(id) ON DELETE CASCADE,
    date TEXT NOT NULL,
    start_time TEXT NOT NULL,
    end_time TEXT NOT NULL,
    break_start TEXT,
    break_end TEXT,
    status TEXT DEFAULT 'PENDIENTE',
    reason TEXT,
    created_at TEXT NOT NULL,
    approved_by INTEGER REFERENCES users(id) ON DELETE SET NULL
  );
DROP TABLE IF EXISTS "timesheets";
CREATE TABLE timesheets(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER REFERENCES users(id) ON DELETE CASCADE,
    date TEXT NOT NULL,
    start_time TEXT,
    start_lat REAL,
    start_lng REAL,
    start_within INTEGER DEFAULT 0,
    break_start TEXT,
    break_end TEXT,
    end_time TEXT,
    end_lat REAL,
    end_lng REAL,
    end_within INTEGER DEFAULT 0
  );
DROP TABLE IF EXISTS "users";
CREATE TABLE users(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    email TEXT UNIQUE NOT NULL,
    password_hash TEXT NOT NULL,
    role TEXT NOT NULL CHECK(role IN ('ADMIN','WORKER')),
    company_id INTEGER REFERENCES companies(id) ON DELETE SET NULL,
    active INTEGER DEFAULT 1
  );
DROP TABLE IF EXISTS "vacation_requests";
CREATE TABLE vacation_requests(
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    user_id INTEGER REFERENCES users(id) ON DELETE CASCADE,
    start_date TEXT NOT NULL,
    end_date TEXT NOT NULL,
    status TEXT DEFAULT 'PENDIENTE',
    reason TEXT,
    created_at TEXT NOT NULL,
    approved_by INTEGER REFERENCES users(id) ON DELETE SET NULL
  );
COMMIT;